import React from "react";
import { useLocation } from "react-router-dom";

const ResultsPage = () => {
  const location = useLocation();
  const results = location.state?.results; // Access results passed via `navigate`

  if (!results) {
    return <h2>No results available. Please submit your exam first.</h2>;
  }

  return (
    <div className="container mt-5">
      <h1 className="text-success">Exam Results</h1>
      <p><strong>Score:</strong> {results.score}/{results.totalQuestions}</p>
      <p><strong>Percentage:</strong> {((results.score / results.totalQuestions) * 100).toFixed(2)}%</p>
      <p><strong>Exam ID:</strong> {results.examId}</p>
      <button onClick={() => window.location.href = "/exam-selection"} className="btn btn-primary">
        Go Back to Exams
      </button>
    </div>
  );
};

export default ResultsPage;
